import React from "react";
import {BrowserRouter as Router, Route} from 'react-router-dom'
import Carousel from 'react-bootstrap/Carousel';
import EstudiosComponent from "./EstudiosComponent";
import OcioComponent from "./OcioComponent";
import TrabajoComponenti from "./TrabajoComponenti";
import SideLeftComponent from "./SideLeftComponent";


const BodyComponent = () => {
  return (
    <Router>
      <div className="flex">
        <SideLeftComponent />
        <div className="content">
          <Route path="/Trabajo" exact={true} component={TrabajoComponenti} />
          <Route path="/Estudios" exact={true} component={TrabajoComponenti} />
          <Route path="/Ocio" exact={true} component={TrabajoComponenti} />
        </div>
      </div>
    </Router>
  );
};

export default BodyComponent;
